        var left_placeholder = document.getElementById('coldplay');
        left_placeholder.style.left = Math.floor(window.innerWidth / 2) - 250/2 - 350 + 'px';
        left_placeholder.style.top = Math.floor(window.innerHeight / 2) - 250/2 + 'px';

        /* beethoven */
        var right_placeholder = document.getElementById('beethoven');
        right_placeholder.style.left = Math.floor(window.innerWidth / 2) - 250/2 + 350 + 'px';
        right_placeholder.style.top = Math.floor(window.innerHeight / 2) - 250/2 + 'px';
      };

      var start = function() {
        game.createExplosion2(window.innerWidth / 2, window.innerHeight / 2);
        game.start();
        document.getElementById('start').style.display = 'none';
        document.getElementById('beethoven').style.display = 'none';
        document.getElementById('coldplay').style.display = 'none';
        document.getElementById('title').style.display = 'none';
      };

    </script>
  </head>
  <body onload="init()" style="overflow:hidden; margin:0; background: #000">
    <canvas id="canvas"></canvas>
    <img id="title" style="position:absolute; width:345px; height:147px;" src="img/title.png"></img>
    <img id="start" style="position:absolute; width:250px; height:250px;" src="img/starships.png"></img>
    <img id="coldplay" style="position:absolute; width:250px; height:250px;" src="img/coldplay_left.png"></img>
    <img id="beethoven" style="position:absolute; width:250px; height:250px;" src="img/beethoven_right.png">
  </body>
</html>
